import React from 'react';
import { useHistory } from 'react-router-dom';
import './StartPage.css';


// Define social skills with symbols and definitions
const socialSkills = [
    { name: 'Active Listening', symbol: '👂', definition: 'Definition of Active Listening' },
    { name: 'Ambiguity Tolerance', symbol: '⏳', definition: 'Definition of Ambiguity Tolerance' },
    { name: 'Conflict Avoidance', symbol: '🚫', definition: 'Definition of Conflict Avoidance' },
    { name: 'Conflict Resolution', symbol: '⚖️', definition: 'Definition of Conflict Resolution' },
    { name: 'Empathy', symbol: '❤️', definition: 'Definition of Empathy' },
    { name: 'Cultural Competence', symbol: '🌍', definition: 'Definition of Cultural Competence' },
    { name: 'Advising and Instruction', symbol: '📚', definition: 'Definition of Advising and Instruction' },
    { name: 'Paraphrasing', symbol: '🔄', definition: 'Definition of Paraphrasing' },
    { name: 'Negotiation', symbol: '💼', definition: 'Definition of Negotiation' },
    { name: 'Debate', symbol: '🗣️', definition: 'Definition of Debate' },
    { name: 'Behavioral Counseling', symbol: '🧠', definition: 'Definition of Behavioral Counseling' },
    { name: 'Assertive Communication', symbol: '🗨️', definition: 'Definition of Assertive Communication' },
];

const StartPage = () => {
    const history = useHistory();

    const handleSkillClick = (skillName) => {
        // Navigate to HomePage with skillName as a parameter
        history.push(`/HomePage`);
    };

    return (
        <div className="start-page">
            <div className="headline">Social Sprout!</div>
            <div className="body-text">
                Select a social skill to learn more about it and train your abilities!
                You can always return to this screen by clicking the back button in the upper right hand corner.
            </div>
            <div className="skill-grid">
                {socialSkills.map((skill, index) => (
                    <div
                        key={index}
                        className="skill-tile"
                        onClick={() => handleSkillClick(skill.name)}
                    >
                        <div className="symbol">{skill.symbol}</div>
                        <div className="skill-name">{skill.name}</div>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default StartPage;
